import React from 'react';
import './Startgame.css'
const Startgame = () => {
  return (
    <div className='game'>
    <div className='game-container'>
     <div className='topeading'>
     <h1>X <span>O</span></h1>
     <p>X TURN</p>
     <button>refresh</button>
     </div>
    </div>
  </div>
  );
}

export default Startgame;
